PREFIX dbr: <http://dbpedia.org/resource/>

SELECT ?work WHERE {
  VALUES ?betoguedes { 
    dbr:Beto_Guedes 
  }

  ?work dbo:writer ?betoguedes .
  ?work rdf:type ?type .

  FILTER (
    (?type = dbo:Single || ?type = dbo:MusicalWork || ?type = dbo:Soundtrack) &&
    EXISTS { ?betoguedes a dbo:Musician . }
  )
}
```

```sparql
PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbr: <http://dbpedia.org/resource/>

SELECT ?predecessor ?spouse WHERE {
  # Identify Louis IV, Grand Duke of Hesse
  VALUES ?louisIV { 
    dbr:Ludwig_IV,_Grand_Duke_of_Hesse 
  }

  # Find a child of Louis IV
  ?child dbo:parent ?louisIV .

  # Find the successor of this child
  OPTIONAL { ?successor dbo:predecessor ?child . }

  # Find the predecessor of the parent (Louis IV) which is the predecessor of the child's successor
  ?predecessor dbo:successor ?successor .

  # Ensure all entities are royalty
  FILTER EXISTS { ?louisIV a dbo:Royalty }
  FILTER EXISTS { ?child a dbo:Royalty }
  FILTER EXISTS { ?successor a dbo:Royalty }
  FILTER EXISTS { ?predecessor a dbo:Royalty }

  # Identify Anna Magdalena Appel and her spouse
  VALUES ?annaMagdalena {
    dbr:Anna_Magdalena_Apple 
  }

  OPTIONAL { ?annaMagdalena dbo:spouse ?spouse . }

  FILTER EXISTS { ?spouse a dbo:Royalty }
}
```

