  FILTER EXISTS { ?greatGrandchild a dbo:Royalty }

  # Step 4: Identify this great-grandchild's father, who must be a royalty and an office holder
  ?father dbo:parent ?greatGrandchild .
  FILTER EXISTS { ?father a dbo:OfficeHolder }
  FILTER EXISTS { ?father a dbo:Royalty }

  # Step 5: Find the child of this father (the great-great-grandchild), who must be a royalty
  ?greatGreatGrandchild dbo:parent ?father .
  FILTER EXISTS { ?greatGreatGrandchild a dbo:Royalty }

  # Step 6: Find the predecessor of this great-great-grandchild
  ?predecessor dbo:successor ?greatGreatGrandchild .
