    ?child1 dbo:parent ?ancestor ;
            dbo:royalTitle ?title1 ;
            dbo:officeHolder ?office1 .

    FILTER EXISTS { ?title1 }
    FILTER EXISTS { ?office1 }

    ?child2 dbo:parent ?child1 .

    ?predecessor dbo:parent ?child2 .
