  # Step 3: Identify the father of a child related to Emperor Antoku
  ?antokuFather a dbo:Person ;
                foaf:name "Emperor Antoku"@en .

  OPTIONAL {
    ?antokuChild dbo:parent ?antokuFather .

    ?fatherOfAntokuChild dbo:child ?antokuChild ;
                         dbo:royalTitle ?title2 ;
                         dbo:officeHolder ?office2 .

    FILTER EXISTS { ?title2 }
    FILTER EXISTS { ?office2 }
  }

  # Step 4: Find the spouse of the identified royalty
  OPTIONAL {
