PREFIX dbr: <http://dbpedia.org/resource/>

SELECT ?conflict ?organization WHERE {
  # Abd el-Krim's involvement in a military conflict as commander
  ?conflict dbo:commanderInForce dbr:Abd_el-Krim .

  # Carlos Franco Iribarnegaray and Francisco Largo Caballero's roles in government agencies or organizations
  OPTIONAL { 
    ?organization dbo:leader dbr:Carlos_Franco_Iribarnegaray ;
                  a dbo:GovernmentAgency ;
                  dbo:reference dbr:Francisco_Largo_Caballero .
  }

  OPTIONAL {
    ?organization dbo:commanderInForce dbr:Francisco_Largo_Caballero ;
                  a dbo:GovernmentAgency .
  }
}
```

