SELECT ?associatedArtist WHERE {
  # Scott LaFaro's associated musical artist
  OPTIONAL { 
    VALUES ?scottLaFaro { dbr:Scott_LaFaro }
    ?scottLaFaro dbo:associatedMusicalArtist ?artist1 .
    FILTER EXISTS { ?artist1 a dbo:Artist . ?artist1 a dbo:MusicalArtist . }

    # Associated musical artist of the above artist
    OPTIONAL {
      ?artist1 dbo:associatedMusicalArtist ?artist2 .
      FILTER EXISTS { ?artist2 a dbo:Artist . ?artist2 a dbo:MusicalArtist . }

      # Bob Marley's professional role or associated musical artist
      OPTIONAL {
        VALUES ?bobMarley { dbr:Bob_Marley }
        ?bobMarley dbo:profession ?profession .
        FILTER (?profession = "Musician" || ?profession = "Singer")

        OPTIONAL {
          ?bobMarley dbo:associatedMusicalArtist ?artist3 .
          FILTER EXISTS { ?artist3 a dbo:Artist . ?artist3 a dbo:MusicalArtist . }

          # Paul Laurence Dunbar Chambers Jr.'s birth and associated musical artist
          OPTIONAL {
            VALUES ?paulChambers { dbr:Paul_Laurence_Dunbar_Chambers_Jr. }
            ?paulChambers dbo:birthPlace ?birthPlace .

            OPTIONAL {
              ?paulChambers dbo:associatedMusicalArtist ?artist4 .
              FILTER EXISTS { ?artist4 a dbo:Artist . ?artist4 a dbo:MusicalArtist . }

              # Final associated artist
              ?artist2 = ?artist3 .
              ?artist3 = ?artist4 .
              BIND(?artist4 AS ?associatedArtist)
            }
          }
        }
      }
    }
  }
}
