  # Mustafa III's father who is a royalty
  ?mustafaIII dbr:Mustafa_III .
  ?fatherMustafa dbo:fatherOf ?mustafaIII ;
                 dbo:royalTitle ?titleMustafa .

  # Abdulaziz's grandfather (father of his father)
  ?abdulaziz dbr:Abdulaziz_I_of_Ottoman_Empire .
  ?fatherAbdulaziz dbo:fatherOf ?abdulaziz ;
                   dbo:fatherOf ?grandfatherAbdulaziz .

  # Ahmed III's child
  ?ahmedIII dbr:Ahmed_III .
  OPTIONAL { ?childAhmed dbo:childOf ?ahmedIII . }

  # The person we are looking for is the child of both Mustafa III's father and Abdulaziz's grandfather
  ?commonAncestor dbo:fatherOf ?mustafaIII ;
                  dbo:fatherOf ?grandfatherAbdulaziz .

  # This common ancestor must be a successor to Ahmed III's child
  OPTIONAL { ?successor dbo:successor ?childAhmed . }

  FILTER EXISTS {
    ?commonAncestor = ?fatherMustafa .
    ?commonAncestor = ?fatherAbdulaziz .
    ?commonAncestor = ?successor .
  }

  # The final person we are looking for is the child of this common ancestor
  ?child dbo:childOf ?commonAncestor .
}
